import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState();

  useEffect(() => {
    fetch("http://127.0.0.1:5000/")  // Replace with the correct URL of your Flask app
      .then(res => res.json())
      .then(data => {
        setData(data);
        console.log(data);
      })
      .catch(error => console.error('Error fetching data:', error));

  }, []);

  return (
    <div>
      {data && (
        <p>Prediction: {data}</p>
      )}
    </div>
  );
}

export default App;
